import React, { useEffect, useState } from 'react';
import axios from 'axios';
import MasterAgentForm from './MasterAgentForm';
import SubAgentList from './SubAgentList';
import './styles/Dashb';

const Dashboard = () => {
  const [masterAgents, setMasterAgents] = useState([]);
  const [selectedMasterAgent, setSelectedMasterAgent] = useState(null);

  useEffect(() => {
    loadMasterAgents();
  }, []);

  const loadMasterAgents = async () => {
    const result = await axios.get('/api/master-agents');
    setMasterAgents(result.data);
  };

  return (
    <div className="container mt-5">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h1>Dashboard</h1>
        <MasterAgentForm onAdd={loadMasterAgents} />
      </div>
      <div className="row">
        {masterAgents.map(agent => (
          <div key={agent.MasterAgentId} className="col-md-4 mb-3">
            <div className="card">
              <div className="card-body">
                <h5 className="card-title">{agent.Name}</h5>
                <p className="card-text">{agent.Details}</p>
                <button
                  className="btn btn-primary"
                  onClick={() => setSelectedMasterAgent(agent.MasterAgentId)}
                >
                  View Sub Agents
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>
      {selectedMasterAgent && (
        <SubAgentList masterAgentId={selectedMasterAgent} />
      )}
    </div>
  );
};

export default Dashboard;
